import { BrowserRouter, Routes, Route} from 'react-router-dom';
import {Box, createTheme, ThemeProvider} from '@mui/material';


import {Navbar, Home, EditDescriptionPage, Issues, UploadVideo, IssuesPage} from './components';
import VideoPage from './components/VideoPage';

const theme = createTheme({
    palette: {
      primary: {
        main: '#D9D9D9',
        dark: "#33363F",
      },
      secondary: {
        main: '#1D5B79',
        light: '#EF6262',
        contrastText: 'white',
      },
      typography: {
        allVariants: {
          color: 'white'
        },
      },
    },
  });


const App = () => (
    <ThemeProvider theme={theme}>
    <BrowserRouter>
    <Box sx={{backgroundColor : '#fff'}}>
        <Navbar/>
        <Routes>
        {/* Home here is the feed */}
            <Route path='/' exact element={<Home />} />
            <Route path='/VideoPage' element={<VideoPage/>} />
            <Route path='/EditDescriptionPage' element={<EditDescriptionPage/>} />
            <Route path='/Issues' element={<Issues/>} />
            <Route path='/UploadVideo' element={<UploadVideo/>} />
            <Route path='/IssuesPage' element={<IssuesPage/>} />
        </Routes>
    </Box>
    </BrowserRouter>
    </ThemeProvider>
)

export default App;
